import React, {Component} from "react";

class Tasks extends Component{
    render(){
        return(
            this.tasks.tasks.map( e =>
            <div>
              <p key={e.id}>{e.id} - {e.titulo} - {String(e.done)}</p>
            </div> 
            )
        )
    }
    
}

export default Tasks;
